import React, { useState, useEffect } from "react";
import Card from "./Card";
import "./style.css";
import Swal from "sweetalert2";
import im1 from "./images/m1.jpg";
import { useDispatch, useSelector } from "react-redux";
import { scoreUpdate } from "../../store/action/authActions";
import { useHistory } from "react-router";
const MemoryGame = ({ options, setOptions, highScore, setHighScore }) => {
  const score = useSelector((state) => state.user.user?.score);
  const [game, setGame] = useState([]);
  const [flippedCount, setFlippedCount] = useState(0);
  const [flippedIndexes, setFlippedIndexes] = useState([]);
  const dispatch = useDispatch();
  const history = useHistory;

  // const colors = [
  //     './images/m2.jpg',
  //     './images/m1.jpg',
  //     './images/m3.jpg',
  //     './images/m4.jpg',
  //     './images/m5.jpg',
  //     './images/m6.jpg',
  //     './images/m7.jpg',
  //     './images/m8.jpg',
  //     './images/m9.jpg',
  //     './images/m10.jpg',
  //     './images/m12.jpg',
  //     './images/m13.jpg',
  // ]
  const colors = [
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRs_QaBYzXERgz0hMtVCKpfiBaRpGVJqrZ4Hh9U8VLr0y3TnhgRAMHsz5QwTeiqPKTfoRc&usqp=CAU",
    "https://thumbs.dreamstime.com/z/vector-cartoon-illustation-planet-venus-space-dark-sky-star-background-hand-drawn-lettering-name-virtual-planets-venus-120161545.jpg",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQNOnlhP9JJuf3FPlbw42Ho0KZeIYahgcSqVb-brWTNBAU-IcKDOGpMYvujbfv--D_S73A&usqp=CAU",
    "https://thumbs.dreamstime.com/z/mars-planet-vector-globe-mars-texture-map-flat-style-globe-vector-mars-view-space-red-planet-solar-system-vector-cartoon-120161179.jpg",
    "data:image/jpeg;base64,",
    "https://image.shutterstock.com/image-vector/vector-cartoon-illustration-saturn-planet-600w-605667512.jpg",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQhtxHWHkj9vkAUmjuwkUUlDC6SAJ2r0OsYY9qmPaosb2YjTSkRY-ZsM6WJZDMhMrLc3nw&usqp=CAU",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://planetpailly.files.wordpress.com/2015/08/ag13-galilean-moons.jpg",
    "https://spaceplace.nasa.gov/review/how-many-moons/moons-01.en.png"



  ];

  useEffect(() => {
    const newGame = [];
    for (let i = 0; i < options / 2; i++) {
      const firstOption = {
        id: 2 * i,
        colorId: i,
        backgroundImage: `url(${colors[i]})`,
        // color: colors[i],
        flipped: false,
      };
      const secondOption = {
        id: 2 * i + 1,
        colorId: i,
        backgroundImage: `url(${colors[i]})`,
        // color: colors[i],
        flipped: false,
      };

      newGame.push(firstOption);
      newGame.push(secondOption);
    }

    const shuffledGame = newGame.sort(() => Math.random() - 0.5);
    setGame(shuffledGame);
  }, []);

  useEffect(() => {
    const finished = !game.some((card) => !card.flipped);
    if (finished && game.length > 0) {
      setTimeout(() => {
        const bestPossible = game.length;
        let multiplier;

        if (options === 12) {
          multiplier = 5;
        } else if (options === 18) {
          multiplier = 2.5;
        } else if (options === 24) {
          multiplier = 1;
        }

        const pointsLost = multiplier * (0.66 * flippedCount - bestPossible);

        let _score;
        if (pointsLost < 100) {
          _score = 100 - pointsLost;
        } else {
          _score = 0;
        }

        if (_score > highScore) {
          setHighScore(Math.round(_score));
          const json = JSON.stringify(Math.round(_score));
          localStorage.setItem("memorygamehighscore", json);
        }

        const newGame = Swal.fire({
          title: "you win",
          text: `your score is : ${Math.round(_score)}`,

          icon: "success",
          showCancelButton: true,
          confirmButtonColor: "#3085d6",
          cancelButtonColor: "#d33",
          confirmButtonText: "congratulations!!",
        }).then((result) => {
          if (result.isConfirmed) {
            Swal.fire(
              (onclick = dispatch(
                scoreUpdate({ score: `${score + Math.round(_score)}` }, history)
              ))
            );
          }
        });

        // const newGame = window.confirm(
        //   "You Win!, SCORE: " + score + " New Game?"
        // );
        if (newGame) {
          const gameLength = game.length;
          setOptions(null);
          setTimeout(() => {
            setOptions(gameLength);
          }, 5);
        } else {
          setOptions(null);
        }
      }, 500);
    }
  }, [game]);

  if (flippedIndexes.length === 2) {
    const match =
      game[flippedIndexes[0]].colorId === game[flippedIndexes[1]].colorId;

    if (match) {
      const newGame = [...game];
      newGame[flippedIndexes[0]].flipped = true;
      newGame[flippedIndexes[1]].flipped = true;
      setGame(newGame);

      const newIndexes = [...flippedIndexes];
      newIndexes.push(false);
      setFlippedIndexes(newIndexes);
    } else {
      const newIndexes = [...flippedIndexes];
      newIndexes.push(true);
      setFlippedIndexes(newIndexes);
    }
  }

  if (game.length === 0) return <div>loading...</div>;
  else {
    return (
      <div id="cardds">
        {game.map((card, index) => (
          <div className="cardd" key={index}>
            <Card
              id={index}
              color={card.backgroundImage}
              game={game}
              flippedCount={flippedCount}
              setFlippedCount={setFlippedCount}
              flippedIndexes={flippedIndexes}
              setFlippedIndexes={setFlippedIndexes}
            />
          </div>
        ))}
      </div>
    );
  }
};
export default MemoryGame;
